import React from 'react';
import Postlist from './Postlist';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Postlist />
        <Route exact path="/" component={Postlist} />
      </div>
    </Router>
  );
}

export default App;
